import React from 'react';

const UserList = ({ users }) => {
  return (
    <div>
      <h4>Active Users</h4>
      <ul>
        {users.map((user, index) => (
          <li key={index}>{user}</li>
        ))}
      </ul>
    </div>
  );
};

export default UserList;
